import React from "react";
import Product from "./Product";
import product from '../../img/products/Donas.jpg'

function ProductPage() {
  return (
    <>
      <div class="products">
        <h2 class="titleText">
          NUESTROS <span>P</span>RODUCTOS
        </h2>
      </div>
      <section class="productsList" id="productsList">
        <div class="title">
          <h2 class="titleText">
            <span></span>
          </h2>
        </div>
        <div class="content">
          <Product src={product} name="Donas" price="0.35" description="Ricas Donas Redondas" />
        </div>
      </section>
    </>
  );
}

export default ProductPage;
